import React from 'react'
import App from 'next/app';
import Link from 'next/link'
import Nav from '../components/Nav';


export default class MKApp extends App {
    render() {
        const {Component} = this.props;

        return (
            <div>
               <Nav/> 
                <Component/>
                <footer/>
            </div>
        )
    }
}
